const COMMON_API = process.env.API_CONTEXTPATH;

const URLS = {
  SUBCATEGORY: `${COMMON_API}user/sub_category`,
  USERLOGIN: `${COMMON_API}userlogin`,
  BOOKING_API: `${COMMON_API}user/booking`,
  ADDRESS_API: `${COMMON_API}address`,
};
export default URLS;
